INSERT INTO `aim_bbs_posts` VALUES (81,2,100,0,1,0,1,0,0,0,0,'','三星的只用过2410、2440、2443，更高的只调研过6400，对2450没有碰过，没有经验。\n“调频”这个动作只在xscale的pxa270/pxa3xx上做过，估计要碰到问题的话都差不多。\n\n1. 提升核心频率后，运行时间过长，系统发热，尤其是CPU，而散热措施不够，导致不规律的死机、重启。\n\n2. 提升了核心频率，但没有同步增加CPU核心的供电电压，导致CPU以低频的电压推动高频的运转，相当于“摩托骡拉”，系统会无规律死机。\n\n3. 确保了核心电压，确保了系统散热，还有个关键问题：确保CPU的型号是533MHz的，而不是400MHz的，从订货型号、CPU正面的MASK标志上可以判断出来。datasheet说2450 support 400MHz/533MHz，并不是说每颗2450都支持，而是根据你的需要来提供的。\n产线上按照533MHz的进行流水线生产，但是总是会有次品无法达到533MHz的标准，那么这些货能通过400MHz的测试的话，就会按照400MHz的进行出货，能通过533MHz测试的，就按照高频的出货。两者价格是不同的。\n\n之前做PXA270，最常用的是416MHz，最高的是624MHz，但是624MHz的比416MHz的贵$3-5。一般用416MHz超频跑624MHz，有的能行，有的不稳定，有的直接不启。\n而现在用PXA3xx，可以确保每颗都是624MHz的，这是工艺提升的原因。\n\n其实，400->500，这个就类似PC上的“超频”了，当然是指“内频”超频。\n\nAMD首先推出1GHz的CPU，Intel赶紧跟着推出，但是运行总是死机，分析出来其实是888MHz的CPU超频后的产品，自然不稳定。',0,0,1372750631,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(79,2,99,0,1,0,0,0,0,0,0,'','PADS 可以 AD不是很熟悉~',0,0,1372746945,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(80,2,99,0,1,0,0,0,0,0,0,'','不过，这个应该不能的。这么强大都有？',0,0,1372750093,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(78,2,98,0,1,0,0,0,0,0,0,'','不建议这样做，是否会对通信质量有影响，无法证明，转交生产批量生产后容易引发歧义。不如增加转接芯片，这样大家都放心。',0,0,1372746465,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(77,2,98,0,1,0,0,0,0,0,0,'','我说的这个开漏是双方都是这种属性的话\n\n不会烧',0,0,1372746441,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(76,2,98,0,1,0,0,1,0,0,75,'','[quote=筱筱太子妃,75]如果是开漏的IO，可以直接接口。用5V的上拉[/quote] 不会烧CPLD吗',0,0,1372746423,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(75,2,98,0,1,0,1,0,0,0,0,'','如果是开漏的IO，可以直接接口。用5V的上拉',0,0,1372746376,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(82,2,100,0,1,0,0,1,0,0,81,'','[quote=admin,81]三星的只用过2410、2440、2443，更高的只调研过6400，对2450没有碰过，没有经验。\n“调频”这个动作只在xscale的pxa270/pxa3xx上做过，估计要碰到问题的话都差不多。\n\n1. 提升核心频率后，运行时间过长，系统发...[/quote] 可能是散热不好，内部温度过高；',0,0,1372750702,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(83,2,100,0,1,0,0,0,0,0,0,'','非常感谢shuiyan大侠，以及其他大侠的回答，shuiyan大侠一语到了点子上！\n\n1. 提升核心频率后，运行时间过长，系统发热，尤其是CPU，而散热措施不够，导致不规律的死机、重启。 \n\n我们测试机器没有装壳，散热它再热不至于要用风扇吧，core跑533后其工作电流是一百多个毫安，个人觉得因散热措施不够可能性不大。\n\n2. 提升了核心频率，但没有同步增加CPU核心的供电电压，导致CPU以低频的电压推动高频的运转，相当于“摩托骡拉”，系统会无规律死机。 \n\n2450处理器，三星推荐的是跑400M时，core,mpll,epll,interface都供1.2V电压，\n                           500M时，core供1.275到1.375V电压，mpll,epll,interface供1.2V电压。\n\n这里为了省成本，我们将core,mpll,epll,interface的电源直接连到一起，通过一个1.3V的DC-DC连到一起了。也就是说core在推荐电压范围，\n但是mpll,epll,interface已经超过了规定范围，如果需要调整成推荐范围得改板，这样周期会比较长，个人觉得这里影响应该不会那么大，但是\n也绝不排除不是这里的可能性。不知道这地方您有没经验？\n\n3. 确保了核心电压，确保了系统散热，还有个关键问题：确保CPU的型号是533MHz的，而不是400MHz的，从订货型号、CPU正面的MASK标志上可以判断出来。datasheet说2450 support 400MHz/533MHz，并不是说每颗2450都支持，而是根据你的需要来提供的。 \n产线上按照533MHz的进行流水线生产，但是总是会有次品无法达到533MHz的标准，那么这些货能通过400MHz的测试的话，就会按照400MHz的进行出货，能通过533MHz测试的，就按照高频的出货。两者价格是不同的。 \n\n可以确保型号是533MHZ的，芯片的尾缀是-53.我们也有用270做的，跑的是416M,只是我们这里用533M播放视频会更流畅，反应速度会更快，不跑533M就不怎么体现出2450的优点了，还不如用回2440.\n\n不知道DMA是否对死机有影响，播放电视时用到了一路DMA',0,0,1372750811,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(84,2,100,0,1,0,0,0,0,0,0,'','2部分，我们刚做270板子，买的是416MHz的CPU，eboot部分初始化成了624MHz，而外部供电是按416MHz给的，导致有的板子跑的顺利，有的跑不起来，有的USB下载不稳定，有的跑一段就死，有的正常应用没关系，放视频一会儿就死。总之情况各异。调整了频率后就正常了。\n\n你400MHz时是否用CMMB播放电视了？如果没有可以试着在400MHz放电视看是否会死机，以此可以排除DMA的问题。',0,0,1372750847,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(85,2,101,0,1,0,0,0,0,0,0,'','调试串口打印Unable to handle kernel NULL pointer dereference at virtual address 00000160\npgd = c1320000\n[00000160] *pgd=2131f001, *pmd = 2131f001, *pte = 00000000, *ppte = 00000000\nInternal error: Oops: 7\nCPU: 0\npc : [<c00df474>]    lr : [<c00df6f0>]    Not tainted\nsp : c1325f0c  ip : c1325f30  fp : c1325f2c\nr10: 00000022  r9 : 0007d2c8  r8 : 00000000\nr7 : 00000000  r6 : 00000000  r5 : c01adf64  r4 : 40001a1b\nr3 : c02d62a0  r2 : c1325fb0  r1 : c1325fb0  r0 : c01adf64\nFlags: nzCv  IRQs off  FIQs on  Mode SVC_32  Segment user\nControl: C000317F  Table: 21320000  DAC: 00000015\nProcess pmp_arm_center (pid: 41, stack limit = 0xc1324374)\nStack: (0xc1325f0c to 0xc1326000)\n5f00:                            c01adf64 40001a1b 00000001 00000000 c1325fb0 \n5f20: c1325f50 c1325f30 c00df6f0 c00df458 c16bab00 24000000 00000001 c1325fb0 \n5f40: c1325fb0 c1325f70 c1325f54 c001ee50 c00df6c0 c01883e4 c0178ecc 00000001 \n5f60: c01883a0 c1325f94 c1325f74 c001ef40 c001ee10 c0190280 c1325fb0 00000001 \n5f80: c0003177 c1325fec c1325fac c1325f98 c001f0a8 c001ee8c c0178d60 fefff000 \n5fa0: 00000000 c1325fb0 c001e348 c001f084 00000000 00000061 0007d2d8 00000b06 \n5fc0: 00002c18 0006167c 0007d2c0 00004100 00000000 0007d2c8 00000022 bffff438 \n5fe0: 00000022 bffff40c 0000e880 0000e8c8 60000010 ffffffff 6a714872 afde11af \nBacktrace: \nFunction entered at [<c00df448>] from [<c00df6f0>]\n r8 = C1325FB0  r7 = 00000000  r6 = 00000001  r5 = 40001A1B\n r4 = C01ADF64 \nFunction entered at [<c00df6b0>] from [<c001ee50>]\n r8 = C1325FB0  r7 = C1325FB0  r6 = 00000001  r5 = 24000000\n r4 = C16BAB00 \nFunction entered at [<c001ee00>] from [<c001ef40>]\n r7 = C01883A0  r6 = 00000001  r5 = C0178ECC  r4 = C01883E4\nFunction entered at [<c001ee7c>] from [<c001f0a8>]\n r8 = C1325FEC  r7 = C0003177  r6 = 00000001  r5 = C1325FB0\n r4 = C0190280 \nFunction entered at [<c001f074>] from [<c001e348>]\n r5 = FEFFF000  r4 = C0178D60 \nCode: e5953018 e3140001 e5936000 0a000017 (e5963160) \nKernel panic: Aiee, killing interrupt handler!\nIn interrupt handler - not syncing',0,0,1372751038,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(86,2,101,0,1,0,0,0,0,0,0,'','400M可以播电视而且不会死机，如果频率上升到533M DMA同样能够健壮的播放？今晚开了几台机，有些改了DMA的通道，有些不采用DMA播放在测试，之前通过N种方法尝试硬件的改变，只是mpll,epll,core电压无法分开，一直没有结果，eboot和NK的频率是可以保证都是533的。有两台比较特别，将原来DC-DC的外围电感换成功率电感，能够耐流1A的电感之后， 一台播了近20个小时没死，第二天重测，过半小时死一次，变的就是测试的位置以及电源，另一台播了一晚上没死，第二天测试几个小时后同样死机了，问题相当的怪异',0,0,1372751654,'xiao1437',12,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(87,2,100,0,1,0,0,0,0,0,0,'','400M可以播电视而且不会死机，如果频率上升到533M DMA同样能够健壮的播放？今晚开了几台机，有些改了DMA的通道，有些不采用DMA播放在测试，之前通过N种方法尝试硬件的改变，只是mpll,epll,core电压无法分开，一直没有结果，eboot和NK的频率是可以保证都是533的。有两台比较特别，将原来DC-DC的外围电感换成功率电感，能够耐流1A的电感之后， 一台播了近20个小时没死，第二天重测，过半小时死一次，变的就是测试的位置以及电源，另一台播了一晚上没死，第二天测试几个小时后同样死机了，问题相当的怪异',0,0,1372751710,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(88,2,100,0,1,0,0,0,0,0,0,'','400M下使用DMA和不使用DMA都试过？\n533M下播放同样的源，应该更轻松才对。\n如果你们的测试用例完整，结果无遗漏，而你的描述没偏差，那么从经验判断，软件相关造成死机的可能性不大。可以看看各个clk是否正确，毕竟核心频率上升了，对应的分频系数也应该修改的。\n\nDC-DC的纹波会有50mV-100mV，而且还有输出精度（具体要看DC-DC资料），可能会接近下限值，导致CPU运行在一种临界状态。用示波器测一下最大、最小值，还有峰峰值。\n\n难道原来用的不是电源用功率电感吗？',0,0,1372751733,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(89,2,101,0,1,0,0,0,0,0,0,'','不建议这样做，是否会对通信质量有影响，无法证明，转交生产批量生产后容易引发歧义。不如增加转接芯片，这样大家都放心。',0,0,1372751807,'xiao1437',12,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(90,2,98,0,1,0,0,0,0,0,0,'','不建议这样做，是否会对通信质量有影响，无法证明，转交生产批量生产后容易引发歧义。不如增加转接芯片，这样大家都放心。',0,0,1372751817,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(91,2,99,0,1,0,0,0,0,0,0,'','应该可以，你先在原理图里画一个元件的图。update to 原理图试试。',0,0,1372751867,'xiao1437',12,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(92,2,99,0,1,0,0,0,0,0,0,'','不可以   你pcb都出来了啊    原理图还不容易',0,0,1372751882,'筱筱太子妃',11,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(93,2,109,2,1,0,0,0,0,0,0,'','dsfsdfsdfsdf',0,0,1372756640,'admin',1,'114.249.152.241',1,0,'',0,'','',0,'北京市\r\n','',0),(94,2,115,2,1,0,0,0,0,0,0,'','fasf',0,0,1372774320,'admin',1,'70.79.228.52',1,0,'',0,'','',0,'加拿大\r\n','',0),(95,2,108,2,1,0,1,0,0,0,0,'','真的不错嘛',0,0,1373285870,'test',14,'202.99.113.105',1,0,'',0,'','',0,'天津市\r\n','',0),(96,2,108,2,1,0,0,1,0,0,95,'','[quote=test,95]真的不错嘛[/quote] 什么东西',0,0,1373285907,'test',14,'202.99.113.105',1,0,'',0,'','',0,'天津市\r\n','',0),(97,2,107,0,1,0,1,0,0,0,0,'','test',0,0,1377144785,'天意旋风腿',18,'114.242.178.222',1,0,'',0,'','',0,'北京市\r\n','',0),(98,2,107,0,1,0,0,1,0,0,97,'','[quote=天意旋风腿,97]test[/quote] 哈哈',0,0,1377144849,'天意旋风腿',18,'114.242.178.222',1,0,'',0,'','',0,'北京市\r\n','',0),(99,2,107,0,1,0,0