INSERT INTO `aim_bbs_threads_content` VALUES (101,0,0,0,'各位大侠大家好，我使用ATRM9200QU高低温试验，系统在高温+55时工作正常，但在-40度下，系统出现死机，ARM9200外围电路包括，两片\nSDRAM（256M），FLASH（128M），各芯片均为工业级，但是系统在-40下启动之后过一会就会死机，不知道什么问题啊！请大家指教！\n\n  这个问题从什么地方开始查呢！！1',0,'',0,'','北京市\r\n',''),(102,1,0,0,'公司用MARVELL的PXA系列做了一些项目；\r\n 目前有个PXA3XX的项目，在打板回来后，竟然PXA3XX的标配13MHz的晶振无法启振（以前曾未有过的故障）\r\n \r\n \r\n 解决故障的大体步骤如下：\r\n <一>、\r\n 首先进行多块单板分别测试，结果都是13MHz的晶振无法启振，说明此问题不是个体问题，很可能是共性问题；\r\n 接着检测了焊接，通过更换IC，并检测相关阻抗，得出此故障非焊接的问题；\r\n \r\n <二>、\r\n 后来根据PXA3XX的Power Up Reset Timing，进行测量：\r\n 1、首先系统电源正常；32.768KHz晶振也正常；\r\n 2、VCC_BBATT（RTC功能模块的电源）与PXA3XX的nRESET(复位输入信号)以及nBATT_FAULT等对应的时序都正常；\r\n 3、SYS_EN、VCC_MVT、VCC_SYSEN、PWR_EN、PWR_SCL、PWR_SDA、nRESET_OUT等电源与信号都已按照相关时序，正确给出。\r\n 4、对应的PMU也正常给出VCC_APPS, VCC_SRAM，\r\n 因为之前已研发出几款PXA3XX的产品，所以时序等问题，基本都不可能存在问题。\r\n \r\n <三>、\r\n 当时怀疑由于PCB布局与布线可能存在问题，导致相关信号的信号完整性不好，从而导致13MHz无法启振，主要进行下列排除：\r\n 1、13MHz的参考电源VVC_MVT,通过相关测量该电源已经供上，且13MHz功能电路的PXTAL_OUT已经输出1.8V（参考电源VVC_MVT即为1.8V），又PXTAL_IN为0，这些都正常，从而排除VVC_MVT电源信号完整。\r\n 2、VCTCXO_EN（PXA3XX使能外部晶振的使能管脚）对应的参考电源VCC_IO1，通过相关测量该VCC_IO1的确存在，而且幅度很符合要求；\r\n \r\n <四>、\r\n 但是通过测量其他PXA33XX项目的单板的13MHz启振前，VCTCXO_EN会从低电平变成高电平，之后PXTAL_OUT与PXTAL_IN才会产生\r\n 1.8V的振荡信号，这是一个疑点；暂时MARK。\r\n \r\n <五>、\r\n 为了验证与排除NAND FLASH与代码的影响，我把其他PXA3XX项目的单板的NAND FLASH 直接焊接掉，测量时钟，13MHz还是能正常输出。故可排除 OBM代码的影响。\r\n \r\n <终>\r\n 最后通过仔细排查，发现VCC_SRAM_1P4V存在问题，即PMU采用LDO输出VCC_SRAM，在信号命名上位：VCC_SARM_1P4V；而\r\nPXA3XX上则为VCC_SRAM_1P4V，所以两边信号名不一样，从而导致PMU输出的1.4V并没有供给PXA3XX的VCC_SRAM；\r\n 最后通过飞线，把它们连接到一起，故障得以解决，13MHz启振。\r\n \r\n \r\n [color=#FF00FF]<疑问>\r\n 虽然故障得以解决，但深度问题还是是没有彻底弄清楚，恳请牛人解答,同请大家共同探讨，非常感谢；具体深度问题如下：\r\n 1、PXA3XX的Boot ROM的全部功能与CODE\r\n 2、13MHz晶振的启动是需要软件进行怎样的配置？\r\n 3、软件配置后，VCTCXO_EN即输出高电平，也既是说VCTCXO_EN可当成软件配置13MHz的一个标志？[/color]',0,'',0,'','北京市\r\n',''),(100,0,0,0,'各位软硬件高手，这个问题困惑我好久了，麻烦各位分析下原因，shuiyan也能帮忙分析下吗？\r\n \r\n 问题是这样的：\r\n 我们采用的三星的S3C2450平台，做的CMMB电视，处理器跑400M时没见有问题，跑533M后，播放音视频没问题，\r\n 但是通过电视播放器收看CMMB电视后会死机，死机时间距播放开始的时间不等，有时间播放后半小时死，有时候\r\n 几个小时死，不知道大家有没这方面的经验？',0,'',0,'','北京市\r\n',''),(99,0,0,0,'altium designer 10 能把PCB图转化正原理图吗？条件是PCB图有网络。如果能转化，怎么转化呢？',0,'',0,'','北京市\r\n',''),(98,0,0,0,'请问大家 3.3V的CPLD emp570和5V的51单片机可以直接通信吗？\r\n 需要串接电阻或者加上拉电阻吗？暂不考虑用电平转换芯片，越简单越好\r\n 谢谢啦',0,'',0,'','北京市\r\n',''),(103,0,0,0,'PADS Layout里面不能布线，不知道为什么？\r\n \r\n 老是报下面的错误\r\n \r\n Point to be routed from is not connected to layer (Top).',0,'',0,'','北京市\r\n',''),(104,0,0,0,'工程中信号声明了\r\n type defineVD_TYPE is array(50 downto 0) of std_logic_vector(7 downto 0);\r\n signal VD:VD_TYPE;\r\n signal i,j: INTEGER RANGE 255 DOWNTO 0:=0;\r\n 结构体中有状态机，其中片段如下：\r\n when (STATE=3) => \r\n        i<=1+conv_integer( VD(3) );\r\n        j<=1+conv_integer( VD(5) );\r\n       ...............\r\n when (STATE=4) =>\r\n        VD(i)<=VD(j);\r\n       ..........\r\n        将工程下载到FPGA开发板上，在线调试的时候发现 i 和 j 都是正常运算变化的，但是“VD(i)<=VD(j) ”语句没有执行（ 比如计算出 i=5 , j=10时,VD(10)的值并没有赋给VD(5)）。\r\n        有没有人知道原因？紧急求助！',0,'',0,'','北京市\r\n',''),(105,0,0,0,'EEPM7128SLC84的供电为5V，VCCIO也为5V，可是IO输出电压只为4.2V，外围没有接任何东西，IO直接输出VCC。并且，给\r\nEPM7128SLC84供电的LM317电源很烫手，LM317是15V转的5V。各位大虾，请指教，谢谢！！EPM7128SLC84的供电为\r\n5V，VCCIO也为5V，可是IO输出电压只为4.2V，外围没有接任何东西，IO直接输出VCC。并且，给EPM7128SLC84供电的LM317\r\n电源很烫手，LM317是15V转的5V。各位大虾，请指教，谢谢！！PM7128SLC84的供电为5V，VCCIO也为5V，可是IO输出电压只为\r\n4.2V，外围没有接任何东西，IO直接输出VCC。并且，给EPM7128SLC84供电的LM317电源很烫手，LM317是15V转的5V。各位大\r\n虾，请指教，谢谢！！',0,'',0,'','北京市\r\n',''),(106,0,0,0,'使用框架的ezloader编制驱动下载，所有步骤均按照相关资料进行，但是下载不了固件，看不到自己定义的PID/VID.不解中，望赐教。\r\n 按照相关手册上说的，修改模板中的firmware.c文件中的数组，编译出.sys文件；.inf中的VID/PID和固件中定义的一样。\r\n 对于于inf文件，是不是将USB开发光盘中drivers下的EZUSBW2K.inf修改即可，修改其中的VID/PID？',0,'',0,'','北京市\r\n',''),(107,1,0,0,'[img]http://img.bbs.csdn.net/upload/201306/01/1370049100_263418.png[/img]\r\n 这是怎么回事啊？谁能告诉我每一行的首地址？难道不是80 C0 94  D4么？  为什么我这个会重合？',0,'',0,'','北京市\r\n',''),(108,0,0,0,'用过SIL9135,9134芯片的进来帮帮\r\n 输出有波形 显示器显示黑屏',0,'',0,'','北京市\r\n',''),(109,0,0,0,'各位好，最近在调试camera出现了红绿线条问题.当直接将camera模块插到控制主板的模块上时，camera工作正常，图像清晰；当将\r\ncamera模块通过一根5厘米的FPC线接到主板上时，整个预览界面都是红绿色的条格，景象不清晰，工作一段时间就死机；当将camera模块通过一根\r\n10厘米的FPC线接到主板上时，直接就死机，没有任何图像；\r\n 我们走线的数据线等长误差范围为+/-100MIL，不知是不是误差范围太大，导致信号不同步？\r\n 还有我们的端接电阻接在了靠近MCU一端，不知是否有影响？\r\n 请各位有经验的高手帮忙分析下原因，怎么改善！非常谢谢',0,'',0,'','北京市\r\n',''),(110,0,0,0,'在quartus ii 11.0环境下，调用modelsim仿真，在线求救啊···能出来的·分数都给了···不多就是',0,'',0,'','北京市\r\n',''),(111,0,0,0,'请教各位大侠一个问题\r\n 我在MAX232芯片与CPU之间加了个光耦P785做传输数据的隔离\r\n 但是显示出来的数据一会正常一会又是乱码，很不稳定。\r\n \r\n 我用示波器测了光耦输入输出的波形，都为方波，看起没有毛刺干扰，很规整\r\n 我以为是传输速度快了，导致数据丢位\r\n 所以我把波特率从9600下调到4800传输数据后还是没有解决乱码问题\r\n \r\n \r\n 就这么个电路，没有太多的器件，困扰我好久了，哭死了\r\n 再解决不了我实在没信心搞硬件了。。。',0,'',0,'','北京市\r\n',''),(112,0,0,0,'我使用的是一个以AM1808为核心的核心板，已经移植了uboot,内核,文件系统。\r\n 我想要在板上的linux里实现对底板上的LED的控制，LED与AM1808的GPIO管脚相连。\r\n 因此我写了一个C程序如下，然后使用交叉编译工具把.c文件编译成可执行文件。\r\n 然后进入板子的linux把这个程序下载下来运行，结果终端显示：\r\n 01 Testing led...\r\n segementation fault.(core dumped).\r\n 并未实现我想要的GPIO控制。请大家指教。\r\n 由于我初学ARM，对我们所编写的C语言程序与底层硬件怎么关联起来的还是不甚清晰，望大家给予指点。\r\n \r\n 程序如下：\r\n #include <stdio.h>\r\n #include <stdlib.h>\r\n \r\n #define unsigned int uint\r\n \r\n #define PINMUX0  	0x01C14120\r\n #define PINMUX1  	0x01C14124\r\n #define PM0  *(volatile uint*)(PINMUX0)  //gpio管脚复用配置寄存器\r\n #define PM1  *(volatile uint*)(PINMUX1)\r\n \r\n #define GPIO_BASE	0x01E26000\r\n #define led_dir	 *(volatile uint*)(GPIO_BASE+0x10)    //gpio输入输出方向寄存器\r\n #define led_out	 *(volatile uint*)(GPIO_BASE+0x14)    //gpio输出寄存器\r\n \r\n int led()     //配置gpio寄存器\r\n {\r\n int pinmux;\r\n pinmux = PM0;\r\n PM0 = (pinmux & 0xFF00FFF0) | 0x00880008;   //配置为IO功能\r\n pinmux = PM1;\r\n PM1 = (pinmux & 0xFFFFFFF0) | 0x00000008;   \r\n led_dir = 0x00000000;    //配置为输出\r\n         led_out = 0xFFFFFFFF;    //gpio管脚输出高电平\r\n         return 0;\r\n }\r\n \r\n void test(int (*func)(),char *testname,int testid)\r\n {\r\n int status;\r\n printf( \"\\n%02d Testing %s...\\n\",testid,testname );\r\n status = func();\r\n if(status !=0)\r\n {\r\n printf(\"FAIL...error code %d...quitting\\n\",status);\r\n }\r\n else\r\n {\r\n printf(\"test PASS\\n\");\r\n }\r\n }\r\n \r\n int main(void)\r\n {\r\n test(led,\"led\",1);\r\n printf(\"\\n***ALL Tests Passed***\");\r\n return 0;\r\n }',0,'',0,'','北京市\r\n',''),(113,0,0,0,'电路设计是本人的弱项，现在需要一个基于MSP430+NRF2401A的RFID标签卡电路设计，求各路大神给点指导，不甚感激',0,'',0,'','北京市\r\n',''),(114,0,0,0,'adfadfdfadfdf',0,'',0,'','加拿大\r\n',''),(115,0,0,0,'adfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf\r\n\r\nadfadfdfadfdf',0,'',0,'','加拿大\r\n',''),(116,0,0,0,'tese123213123123213分享',0,'',0,'','北京市\r\n',''),(117,0,0,0,'123213213',0,'',0,'','北京市\r\n','');
